import React from "react";
import { Routes, Route } from "react-router-dom";
import ProductDetailPage from "./pages/ProductDetailPage";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/book/:id" element={<ProductDetailPage />} />
      </Routes>
    </div>
  );
}

export default App;
